import React from "react";
import "./Ellipse3.css";

function Ellipse3() {
  return (
    <div className="ellipse-3">
      <img
        className="arcticonsjazzworld"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/arcticons-jazzworld.svg"
        alt="arcticons:jazzworld"
      />
    </div>
  );
}

export default Ellipse3;
